export default class weatherServices {
  static apiKey = '4e3ce6739c49424f2cf2db28dfb21061';
  static getWeather(city) {
    return fetch(
      `https://openweathermap.org/data/2.5/weather?q=${city}&appid=${apiKey}`
    );
  }
}
